import React from 'react';
import './App.css'; // Make sure this file exists or update the name to match

function App() {
  return (
    <div className="App">
      <nav className="navbar">
        <ul className="nav-menu">
          <li className="nav-item">Home</li>
          <li className="nav-item dropdown">
            Services
            <ul className="dropdown-menu">
              <li className="dropdown-item">Live Chat</li>
              <li className="dropdown-item">Live Broadcast</li>
              <li className="dropdown-item">Recipes</li>
            </ul>
          </li>
          <li className="nav-item">Contact</li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
